import AuthConfig from "./auth/auth.config";
import HomeConfig from "./home_page/home.config";
import ForecastConfig from "./forecast/forecast.config";
import AccountConfig from "./account/account.config";

const mainConfigs = [AuthConfig, HomeConfig, ForecastConfig, AccountConfig];

export default mainConfigs;
